%[text] # 例題2.3（べき乗則変換）
%[text] 村松正吾　「多次元信号・画像処理の基礎と展開」
%[text] 動作確認： MATLAB R2025b
%[text] ## 準備
isVerbose = false;
prj = matlab.project.currentProject;
prjroot = prj.RootFolder;
datfolder = fullfile(prjroot,"data");
resfolder = fullfile(prjroot,"results");
myfilename = "exercise02_03"; % mfilename

imgname = "msipimg06";
imgfmt = "tiff";
%%
%[text] ## 画像データの読込
imgfile = fullfile(datfolder,imgname);
X = im2double(rgb2gray(imread(imgfile,imgfmt)));
%%
%[text] ## べき乗測変換のグラフ
% データ
x = linspace(0,1,501);
gammas = [0.25 0.5 1 2 4]; 
n = numel(gammas);

% グレースケール色と線種
grays = [0 0 0.75 0 0]; 
lineStyles = {':','--','-','-.','-'};  % 必要なら増やす
posx = [0.21 0.33 0.46 0.59 0.71];

% 正方形の図と軸
figure(1) %'Units','pixels','Position',[100 100 600 600]);
ax = axes; %[output:2a028a27]
hold(ax,'on'); %[output:2a028a27]

for k = 1:n
    y = x .^ gammas(k);
    plot(ax,x,y, ... %[output:2a028a27]
        'Color',repmat(grays(k),1,3), ... %[output:2a028a27]
        'LineStyle',lineStyles{mod(k-1,numel(lineStyles))+1}, ... %[output:2a028a27]
        'LineWidth',1.5); %[output:2a028a27]
    text(posx(k),posx(k).^gammas(k)-0.01,"$\gamma=$"+num2str(gammas(k)),...
        "Interpreter",'latex')
end

ax.XTick = 0:0.2:1; %[output:2a028a27]
ax.YTick = 0:0.2:1; %[output:2a028a27]
ax.FontSize = 14; %[output:2a028a27]
% 表示調整：範囲固定・データ単位を等しく
axis(ax,[0 1 0 1]); %[output:2a028a27]
daspect(ax,[1 1 1]);    % データ単位の縦横比を1:1 %[output:2a028a27]
xlabel('$x$','Interpreter','latex','FontSize',14); %[output:2a028a27]
ylabel('$y = x^{\gamma}$','Interpreter','latex','FontSize',14); %[output:2a028a27]
%title('べき乗測');
%legend(arrayfun(@(g) sprintf('$\\gamma=%.2g$',g),gammas,'UniformOutput',false),...
    %'Interpreter','latex',...
    %'Location','northwest',...
    %'FontSize',12);
grid on; %[output:2a028a27]
box on; %[output:2a028a27]
hold(ax,'off'); %[output:2a028a27]

exportgraphics(ax,fullfile(resfolder,"fig02-03.png"),'BackgroundColor','white') %[output:2a028a27]

%%
%[text] ## 変換前の画像表示
figure(2)
imshow(X)  %[output:5cdcbd25]
title('原画像')  %[output:5cdcbd25]
%%
%[text] ## べき乗測変換
gamma = 0.25 %[control:slider:540a]{"position":[9,13]} %[output:1dd77687]
Y = X.^(1/2); 
figure(3)
imshow(Y) %[output:9c52b770]
title('処理画像')  %[output:9c52b770]
%%
%[text] ## 結果出力
imwrite(X,fullfile(resfolder,"fig02-04a.png"))
imwrite(Y,fullfile(resfolder,"fig02-04b.png"))
